/* VCD dumping functions */
MOD_mkCache & mkCache_backing(tSimStateHdl simHdl)
{
  static MOD_mkCache *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkCache(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
